// lib/features/auth/presentation/bloc/profile/profile_event.dart
part of 'profile_bloc.dart';

@freezed
class ProfileEvent with _$ProfileEvent {
  const factory ProfileEvent.started() = _Started;
  const factory ProfileEvent.nameUpdated(String newName) = NameUpdated;
  const factory ProfileEvent.passwordChangeRequested({
    required String currentPassword,
    required String newPassword,
  }) = PasswordChangeRequested;
  const factory ProfileEvent.profileImageUpdated(String imageFile) = ProfileImageUpdated;
}

