part of 'profile_bloc.dart';

@freezed
class ProfileState with _$ProfileState {
  const factory ProfileState.initial() = Initial;
  const factory ProfileState.loading() = Loading;
  const factory ProfileState.loaded(User user) = ProfileLoaded;
  const factory ProfileState.failure(Failure failure) = _Failure;
  const factory ProfileState.passwordChangeSuccess() = PasswordChangeSuccess;
}
